// var React=require('react'); // first we writelike this
import React from 'react';//babel converts this line to first
// var ReactDom=require('react-dom');
import ReactDom from 'react-dom';
import './index.css'
const fname="pritam kumar";
const lname="sarangi";
const img1="https://picsum.photos/seed/picsum/300/200";
const img2="https://picsum.photos/seed/picsum/280/180";
const img3="https://picsum.photos/seed/picsum/250/150";
const img4="https://picsum.photos/seed/picsum/210/110";
const img5="https://picsum.photos/seed/picsum/180/90";
const link1="https://picsum.photos/";
ReactDom.render(<>
    <h1 class="heading">{`My name is ${fname} ${lname}`} </h1>
    </>,
    document.getElementById("root"));


ReactDom.render(<><h1>My Netflix Picks</h1>
<p>List of my top 5 series</p>
<ol contentEditable="true">
    <li >Wednesday</li>
    <li>Sacred Games</li>
    <li>squid games</li>
    <li>Paatal Lok</li>
    <li>family Man</li>
</ol>
<a href={link1} target='_blank'>
<img src={img1} />
<img src={img2} />
<img src={img3} />
<img src={img4} />
<img src={img5} />
</a>
</>,
document.getElementById("root2"));

const currdate=new Date().toLocaleDateString();
const currtime=new Date().toLocaleTimeString();

ReactDom.render(<>
    <h1>{`Todays's date is ${currdate} and today's time is ${currtime}`} </h1>
    </>,
    document.getElementById("root3"));
